class Solution(object):
    def canSortArray(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        # Function to count the number of set bits in an integer
        def countSetBits(n):
            return bin(n).count('1')

        # Count the set bits for each number and group them
        bit_groups = {}
        for num in nums:
            bits = countSetBits(num)
            if bits in bit_groups:
                bit_groups[bits].append(num)
            else:
                bit_groups[bits] = [num]

        # Sort each group individually
        for bits in bit_groups:
            bit_groups[bits].sort()

        # Flatten the sorted groups into a single list
        sorted_nums = []
        for bits in sorted(bit_groups.keys()):
            sorted_nums.extend(bit_groups[bits])

        # Check if the flattened, sorted list is equal to the original list sorted
        return sorted_nums == sorted(nums)
